import React  from 'react'

function TestInfo({record, setRecord}) {

  //handle submit functions

  return(
     <div>

        <div className='head_schedule'> 
                  <h5>Created:  <em> {new Date().getFullYear()} </em></h5>
        </div>

      <div className='test_request'>

              <label>
              Test Number: 
              <input 
                  type='text' 
                  value={record.test_number} 
                  onChange = {(event) => 
                  setRecord({...record, test_number: event.target.value})
                  }
              /></label>


              <label>
              Test Name: <input type='text' value={record.name} onChange = {(event) => 
                  setRecord({...record, name: event.target.value})} />
              </label>

              <label>
              Description:  <input type='text' value={record.description} 
                  onChange = {(event) => 
                  setRecord({...record, description: event.target.value}) } />
              </label>


      </div>

     </div>
     ); 

}
